import React, { useState, useEffect } from "react";
import axios from "axios";
import {AvatarWoman, AvatarMan, SettingTwoIcon, SettingThreeIcon, ArrowDown} from "../common/icons/icons.jsx"
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";

const TableEmployee = () => { 
    const [user, setUsers] = useState([]);

    useEffect(() => {
      getUsers();
    }, []);
  
    const getUsers = async () => {
      const response = await axios.get("http://localhost:5000/users");
      setUsers(response.data);
    };
  
    const deleteUser = async (userId) => {
      await axios.delete(`http://localhost:5000/users/${userId}`);
      getUsers();
    };
  
    
//   const dispatch = useDispatch();
//   const navigate = useNavigate();
//   const { isError
//   //,user
//   } = useSelector((state) => state.auth);

//   useEffect(() => {
//     dispatch(getMe());
//   }, [dispatch]);

//   useEffect(() => {
//     if (isError) {
//       navigate("/");
//     }
//     // if(user && user.role !== "admin"){
//     //   navigate("/dashboard");
//     // }
//     // opcja dostępu inny niz admin do dashboard
//   }, [isError,
//     //user,
    
//     navigate]);
return (
    <div>
      <div className="div-table"> 
      <table className="employee-table"> 
        <thead>
          <tr className="employee-tr">
            <th>Imie Nazwisko</th>
            <th>Stanowisko</th>
            <th>Oddział</th>
            <th>Email</th>
            <th>Doświadczenie</th>
            <th className="employee-setting">Opcje</th>
          </tr>
        </thead>
        <tbody>
          {user.map((user, index) => (
            <tr key={user.uuid} className="employee-tr">
              <div className="tr-table-div">
              {/* <td className="td-employee"> {index + 1} </td> */}
              <td className="employee-profile td-employee">     
              { user.sex == "Kobieta"?
                <div className='circle-avatar-women'>{user && `${user.name.charAt(0).toUpperCase()}${user.surname.charAt(0).toUpperCase()}`}</div> 
               :
                <div className='circle-avatar-man'>{user && `${user.name.charAt(0).toUpperCase()}${user.surname.charAt(0).toUpperCase()}`}</div> 
               }
              {user && `${user.name} ${user.surname}`}</td>
              <td className="td-employee">{user.position} {user.role}</td>
              <td className="td-employee">Mników</td>
              <td className="td-employee">{user.email}</td>
              <td className="td-employee">1rok</td>
              <td className="td-employee employee-setting"><ArrowDown className="employee-icon"/></td>
             
                  </div>
                  <div className="under-employee-pop">
                    <div className="pop-column">

                    </div>
                    <div className="pop-column">

                    </div>
                    <div className="pop-column">
                      <Link to={`/users/edit/${user.uuid}`}className="button is-small is-info" >Edit</Link>
                      <button onClick={() => deleteUser(user.uuid)} className="button is-small is-danger"> Delete</button>
                  
                    </div>

                  </div>
            </tr>
          ))}
        </tbody>
      </table>
      </div> 
    </div>
  );
};

export default TableEmployee;
